  false,\n\t\"url\": null,\n\t\"notes\": \"Appendix to the Recovery Plan. Locations
  of current or historical Snowy Plover breeding and wintering areas. The following
  maps (Figures A-1 through A-7) show the general locations of current or historical
  western snowy plover breeding or wintering areas on the U.S. Pacific coast within
  each recovery unit. The breeding and wintering locations and recovery units include
  only the coastal beaches, estuaries, gravel bars and salt ponds that provide western
  snowy plover habitat; inland areas of counties are illustrated on Figures A-1 through
  A-7 solely for reference. Location numbers on the maps are referenced to the numbers
  in parentheses shown after the location names found in the left-hand column of Table
  B-1 (Appendix B) and Table C-1 (Appendix C). Detailed maps of each of these locations
  are given in Appendix L.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
